            <p>Địa điểm: Cần Thơ</p>
          </div>
          <div className="col-sm-4 text-center">
            <img src="shrimp_logo.jpg" alt="icon" width={150} height={150} />
            <p>Nhiệt độ: 30 C</p>
            <p>Độ ẩm: 35%</p>
            <p>Địa điểm: Cần Thơ</p>
          </div>
        </div>
      </div>
    );
  }
}

export default Weather;
